import React, { useEffect, useState } from "react";

function Content({ response }) {
  var content = "";

  response
    ? response.ok
      ? (content = formatContent())
      : (content = "could not find character")
    : (content = "there will be content here!!");

  const formatContent = (content) => {
    const body_json = content.json();

    return "Some content formatted!!";
  };

  return <p>{content}</p>;
}

export default Content;
